$_MODULE['<{pigmbhpaymill}prestashop>paymill_checkout_form_1_5_1c456c8aa0e37e68a9caabc09b39be9f'] = 'Le code CVV ou CVC est une fonctionnalité de sécurité des cartes de crédit. Il se compose en général d\'un nombre de trois à quatre chiffres. Sur les cartes de crédit VISA, il est appelé code CVV. On trouve le même code sur les cartes de crédit MasterCard, où il est appelé cependant CVC. CVC signifie « Card Validation Code » (« Code de validation de carte »). Le code CVV signifie quant à lui « Card Validation Value code » (« code de Valeur de validation de carte »). Similaires à MasterCard et Visa, les autres marques telles que Diners Club, Discover et JCB contiennent un nombre à trois chiffres que l\'on retrouve généralement au dos de la carte de crédit. Les cartes MAESTRO existent avec et sans le CVV à trois chiffres. Si vous utilisez une carte MAESTRO sans CVV, vous pourrez saisir 000 dans le formulaire. American Express utilise le CID (card identification number - numéro d\'identification de carte). Le CID est un nombre à quatre chiffres que l\'on retrouve généralement à l\'avant de la carte, en haut à droite du numéro de carte de crédit.';
